    false,nt"url": null,nt"notes": "In 1989 the Bonneville Power Administration
    (BPA) began funding the evaluation of production groups of juvenile anadromous fish
    not being coded-wire tagged for other programs. These groups were the "Missing
    Production Groups". Production fish released by the U.S. Fish and Wildlife Service
    (USFWS) without representative coded-wire tags during the 1980s are indicated as
    blank spaces on the survival graphs in this report. This program is now referred
    to as "Annual Stock Assessment - CWT" The objectives of the "Annual Stock Assessment"
    program are: to estimate the total survival of each production group, to estimate
    the contribution of each production group to various fisheries, and to prepare an
    annual report for all USFWS hatcheries in the Columbia River basin. This annual
    stock assessment report covers 2003.",nt"license_title": "License Not Specified",nt"extras":
